    private val Char.closingBracket: Char
        get() = when (this) {
            '[' -> ']'
            '{' -> '}'
            '(' -> ')'
            else -> error("Invalid input $this not supported.")
        }

    private val Char.isOpen: Boolean
        get() = this in listOf('[', '{', '(')

    private val Char.isClose: Boolean
        get() = this in listOf(']', '}', ')')

    private fun String.isBalanced(): Boolean {
        val stack = Stack<Char>()
        toCharArray().forEach { c ->
            when {
                c.isOpen -> stack.push(c)
                c.isClose -> if (stack.isEmpty() || c != stack.pop().closingBracket) {
                    return false
                } else {
                    // nothing
                }
                else -> error("Invalid char '$c'")
            }
        }
        return stack.isEmpty()
    }

    fun isBalanced(s: String): String =
        if (s.isBalanced()) {
            "YES"
        } else {
            "NO"
        }

